import uuid from 'uuid'

//********************
//**** ACTIONS *******
//********************

//ACTION CREATOR HELPER FUNCTION
const action = (type, payload) => {
  return { type, payload }
}

//ACTIONS
const ADD_DATA = 'ADD_DATA';

//ACTION CREATORS
export const addData = (versionName, startDate, releaseDate, description) =>
  action(ADD_DATA, {
    key: uuid(),
    versionName,
    startDate,
    releaseDate,
    description
  })
